import { Call, Email, Facebook, Instagram, Map, WhatsApp } from '@material-ui/icons'
import { Google } from '@mui/icons-material'
import React from 'react'
import styled from 'styled-components'
import{mobile} from '../Responsive'
import { Link } from 'react-router-dom'

const Container = styled.div`
  display: flex;
     
  height: fit-content;
  ${mobile({
    flexDirection: "column",
  })}
`;
const Left = styled.div`
    flex: 1;
    padding-top: 20px;
    padding-left: 40px;
    ${mobile({
        paddingLeft: "20px",
    })}
    
`
const Logo = styled.h1`

`
const Contain = styled.div`
background: rgba( 255, 255, 255, 0.2 );
box-shadow: 0 8px 32px 0 rgba( 31, 38, 135, 0.37 );
backdrop-filter: blur( 20.5px );
-webkit-backdrop-filter: blur( 9.5px );
border-radius: 10px;
border: 1px solid rgba( 255, 255, 255, 0.18 );}
`;
const Description = styled.p`
    margin: 20px 0px;
`
const Branding = styled.p`
  margin: 20px 0px;
  text-align: center;
`;
const SocialContainer = styled.div`
    display: flex;
    
`
const SocialIcons = styled.a`
    text-decoration: none;
    width: 40px;
    height: 40px;
    color: white;
    background-color: #${props=> props.color};
    border-radius: 50%;
    display: flex;
    justify-content: center;
    align-items: center;
    margin-right: 20px;
    transition: all 0.3s ease;
    cursor: pointer;
    &:hover {
        transform: scale(1.1);
        filter: drop-shadow(0px 0px 4px #${props=> props.color});
    }

`
const Center = styled.div`
    flex: 1;
    padding: 20px;

    ${mobile({
        marginTop: "20px",
    })}
`
const Title = styled.h3`
    margin-bottom: 20px;
    
`
const List = styled.ul`
    margin: 0;
    padding: 0;
    list-style: none;
    display: flex;
    flex-wrap: wrap;

`
const ListItem = styled.li`
    width: 50%;
    margin-bottom: 10px;
`
const Right = styled.div`
    flex: 1;
    padding: 20px;
`
const ContectItem = styled.p`
    margin-bottom: 20px;
    display: flex;
    

`


function Footer() {
  return (
    <Contain>
      <Container>
        <Left>
          <Logo>PanaraIT.</Logo>
          <Description>
            We are Panara Enterprise Pvt LTD and our company has successfully
            completed many projects with Our Government Of India and also we
            have worked with our State Go...
          </Description>
          <SocialContainer>
            <SocialIcons
              color="3b5998"
              href="https://www.facebook.com/"
              target="_blank"
            >
              <Facebook />
            </SocialIcons>
            <SocialIcons
              color="bc2a8d"
              href="https://www.instagram.com/"
              target="_blank"
            >
              <Instagram />
            </SocialIcons>
            <SocialIcons
              color="075e54"
              href="https://www.whatsapp.com/"
              target="_blank"
            >
              <WhatsApp />
            </SocialIcons>
            <SocialIcons
              color="4885ed"
              href="https://www.google.com/"
              target="_blank"
            >
              <Google />
            </SocialIcons>
          </SocialContainer>
        </Left>
        <Center>
          <Title>Useful Links</Title>
          <List>
            <Link to={"/products/MOUSE&KEYBORD"}>
              <ListItem>Mouse & Key Board</ListItem>
            </Link>
            <Link to={"/products/SCANNER"}>
              <ListItem>Scanner</ListItem>
            </Link>
            <Link to={"/products/PRINTER_MATERIAL"}>
              <ListItem>Printer Material</ListItem>
            </Link>
            <Link to={"/ComplainRegister"}>
              <ListItem> Register Complain </ListItem>
            </Link>
            <Link to={"/login"}>
              <ListItem> Login</ListItem>
            </Link>
            <Link to={"/signup"}>
              <ListItem> Signup</ListItem>
            </Link>
          </List>
        </Center>
        <Right>
          <Title>Contect Us</Title>
          <ContectItem>
            <Map /> 8, Third Floor, Sukh Sagar Complex, Near Kakdiya Hospital,
            Bapunagar
            <br />
            City: AHMEDABAD
            <br />
            State/province/area: GUJARAT
            <br />
            Zip code 382350
            <br />
            Country India
          </ContectItem>
          <ContectItem>
            <Call />
            +91 9328938959
          </ContectItem>
          <ContectItem>
            <Call />
            +91 0794923
          </ContectItem>
          <ContectItem>
            <Email /> patelmihir2712005@gmail.com
          </ContectItem>
        </Right>
      </Container>
      <Branding>Powered by ERBIT SERVICES </Branding>
    </Contain>
  );
}

export default Footer
